> Political House to vote on defense bill that Obama threatens to veto In this Sept. 30, 2015, photo Defense Secretary Ash Carter speaks to reporters during a news conference at the Pentagon. The defense policy bill is one of the few bipartisan measures in Congress that has become law for more than a half-century. Not so fast this year as President Barack Obama threatens to veto the bill moving through the House amid a bitter dispute about government spending. Carter told reporters on Wednesday that he wants Obama to veto it. (AP Photo/Manuel Balce Ceneta) 
